def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    """Even further improved version of `priority`."""
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item > bins[i]:
            priorities[i] = -1
        else:
            left_capacity = bins[i] - item
            if left_capacity == 0:
                priorities[i] = 0
            else:
                if item % 2 == 0:
                    utilization = item / bins[i]
                    if utilization < 0.2:
                        priorities[i] = 1 / (1 - utilization)
                    elif 0.2 <= utilization < 0.6:
                        priorities[i] = 3
                    elif 0.6 <= utilization < 0.8:
                        priorities[i] = 5
                    else:
                        priorities[i] = np.sqrt(item * (left_capacity / item))
                else:
                    utilization = item / bins[i]
                    if utilization < 0.3:
                        priorities[i] = 1 / (1 - utilization)
                    elif 0.3 <= utilization <= 0.7:
                        priorities[i] = 4
                    else:
                        priorities[i] = np.cbrt(item * (left_capacity / item))

    return priorities
